import React, {Component} from 'react';
import { NavLink } from 'react-router-dom';

class Home extends Component {
    state = {
        authorized: false
    }

    componentDidMount(){
        let check = localStorage.getItem('team');
        if (check) {
            this.setState({
                authorized: check
            });
        }
        console.log(this.props.history.location)
    }

    render() {
        return (
            <div>
                {!this.state.authorized ?
                    <div>
                        <div className="team">
                            <NavLink to="/aaa">
                                <img src="./pics/Atlas.png" alt="Atlas"/>
                                Облачный атлас
                            </NavLink>
                        </div>
                        <div className="team">               
                            <NavLink to="/bbb">
                                <img src="./pics/duna.jpg" alt="Спайс и Черви"/>
                                Спайс и Черви                        
                            </NavLink>
                        </div>
                        <br/>
                        <div className="team">
                            <NavLink to="/ccc">
                                <img src="./pics/Atlas.png" alt="Atlas"/>
                            </NavLink>
                        </div>
                    </div>
                    :
                    <div>
                        Вы уже начали игру как команда {this.state.authorized}. Нажмите вперед в браузере.
                    </div>
                }
            </div> 
        )
    }
}

export default Home;
